def decode_numbers_to_ascii(numbers):
    # Convert each number (0-15) to 4-bit binary
    binary_string = ''.join(f'{num:04b}' for num in numbers)
    
    # Split into 8-bit chunks
    bytes_list = [binary_string[i:i+8] for i in range(0, len(binary_string), 8)]
    
    # Convert each 8-bit chunk to ASCII character
    decoded_text = ''.join(chr(int(byte, 2)) for byte in bytes_list if len(byte) == 8)
    
    return decoded_text

